import { CYAN } from "../helpers/colors"

const Example = () => {
    const name = ['zahra', 'sara', 'maryam']

    return (
        <div style={{ backgroundColor: Fore }}>
            {name.map((name, index) => (
                <p key={index}>Hello {name}</p>
            ))}
        </div>
    )
}

export default Example
